column5:
O produto interno bruto a preços de mercado representa o resultado final da actividade de produção das unidades produtivas residentes. Pode ser definido de três formas:

a) Óptica da produção: o PIB é igual à soma dos valores acrescentados brutos dos diferentes sectores institucionais ou ramos de actividade, mais os impostos líquidos dos subsídios aos produtos (que não são afectados aos sectores e ramos de actividade). É igualmente o saldo da conta de produção total da economia;

b) Óptica da despesa: o PIB é igual à soma das utilizações finais de bens e serviços (consumo final e formação bruta de capital) das unidades institucionais residentes, mais a exportação e menos a importação de bens e serviços;

c) Óptica do rendimento: o PIB é igual à soma das utilizações da conta de exploração do total da economia (remuneração dos empregados, impostos sobre a produção e a importação líquidos de subsídios, excedente bruto de exploração e rendimento misto do total da economia). (metainformação – Sistema Europeu de Contas) Os valores são brutos quando não deduzem o consumo de capital fixo.
